 /* CREATE 500 DOMAINS ON THE USERS ACCOUNT  */



Update Domain set D_Ren_Dt = CURDATE() + Interval 1 Day where D_Name like 'my-domain-%' and A_Number=1 limit 100;
Delete from Domain where D_Name like 'my-domain-%' and A_Number=1 and DSM_State != 25;
Delete from Domain where D_Name like 'my-domain-%' and D_Ren_Dt < curdate() + interval 1 day;
Update Domain set D_Reg_Dt = D_Ren_Dt - Interval 1 Year where D_name like 'my-domain-%' and D_Ren_Dt = CURDATE() + Interval 1 day limit 85;
